import React from 'react';
import '../stylesheets/navbar.css';

import logo from '../images/static-logo.png';
import { flexBox } from './bootstrap/classnames';

function Navbar() {

  return (
<div className='d-flex justify-content-between align-items-center pl-4'>
 <img style={{height:'80px', width:'100%', objectFit:'cover'}}src={logo}></img>
 <ul className={flexBox} id='nav-container'>
      <li className='p-1'><a href='#'>MOTION GRAPHICS </a></li>
      <li className='p-1'><a href='#'>GRAPHIC DESIGN</a></li>
      <li className='p-1'><a href='#'>CONTACT</a></li>
    </ul>
</div>
  );
};


export default Navbar;
